import React from 'react';
import EditForm from './EditForm'

class EditContainer extends React.Component {
    constructor(props) {
        super(props)
        // console.log(this.props.list)
        console.log(this.props.match.params.listing_id)

        let indList = this.props.list[this.props.match.params.listing_id]
        this.state ={
            displayEdit: true,
            listing_id: indList.listing_id,// later change to this.props.listing_id
              item_name: indList.item_name,
              unit_price:indList.unit_price,
              quantity: indList.quantity,
              price_ceiling: indList.price_ceiling,
              price_floor: indList.price_floor,
              category_id: indList.category_id,
              merchant_id: indList.merchant_id,
              description: indList.description,
              time_limit_min: indList.time_limit_min,
        }
    }
    render(){

        return (
            <div>
            <EditForm item_name={this.state.item_name} listing_id={this.state.item_name} unit_price={this.state.unit_price} quantity={this.state.quantity} price_ceiling={this.state.price_ceiling} price_floor={this.state.price_floor} category_id={this.state.category_id} merchant_id={this.props.merchant_id} description={this.state.description} time_limit_min={this.state.time_limit_min}/>
            </div>

            )
    }
}
export default EditContainer;
